  })
  .then(() => {
    //Compile successfully
  })
  .catch(() => {
    //Compile failed
  });

const { Content } = Layout;

const AntLayout = ({ children }) => (<Layout>
  <AntHeader />
  <Layout>
    <AntSidebar />
    <Layout style={{ padding: '0 24px 0 24px' }}>
      <AntBreadcrumb />
      <Content>
        {children}
      </Content>
      <AntSetting />
      <AntFooter />
    </Layout>
  </Layout>
</Layout>);

